import React, { Fragment } from "react";

const Header = () => {
  return (
    <Fragment>
      <header>
        <h1>React Meals </h1>
        <button>Cart Icon </button>
      </header>

      <div>
        <img src="favicon.svg" />
      </div>
    </Fragment>
  );
};
export default Header;
